'use strict';
import totalEnergyConsumption from "./totalEnergyConsumption.js";
import totalEnergyProduction from "./totalEnergyProduction.js";
import rawCoalProduction from "./rawCoalProduction.js";
import crudeOilProduction from "./crudeOilProduction.js";
import naturalGasProduction from "./naturalGasProduction.js";
import powerGeneration from "./powerGeneration.js";
import chinamap from "./Chinamap.js";
import ssankey from "./sankey.js";

import * as d3 from "d3";

import csv0 from "./assets/total energy consumption.csv";
import csv1 from "./assets/total energy production.csv";
import csv2 from "./assets/raw coal production.csv";
import csv3 from "./assets/crude oil production.csv";
import csv4 from "./assets/natural gas production.csv";
import csv5 from "./assets/power generation.csv";
import China from "./assets/china.json";
import rldata from "./assets/sankey.json";

//能源消费总量及构成
d3.csv(csv0).then((data, error) => {
  if (error) {
    console.log(error);
  } else {
    console.log(data);
    totalEnergyConsumption(data, {

    });
  };
});

//选择种类
let selectedTypeValue;
function updateDataType() {
  var selectType = document.getElementById("type");
  selectedTypeValue = parseInt(selectType.options[selectType.selectedIndex].value);
}

//选择年份
let selectedYearValue;
function updateDataYear() {
  var selectYear = document.getElementById("year");
  selectedYearValue = parseInt(selectYear.options[selectYear.selectedIndex].value);

  updateDataType();

  // 全国各地区能源生产量
  d3.csv(csv1).then((data, error) => {
    if (error) {
      console.log(error);
    } else {
      //选择年份
      data = d3.filter(data, d => { if (d["年份"] == selectedYearValue) return d; });
      console.log(data);
      totalEnergyProduction(data, {

      });
    };
  });

  //中国地图
  d3.csv(csv2).then((data, error) => { 
      if (error) {
        console.log(error);
      } else {
        
        data = d3.filter(data, d => { if (d["年份"] == 2015) return d; });
        chinamap(China,data,{

        });
      };
    });


    //sankey图
    rldata.line = d3.filter(rldata.line,d => {if(d.year == 2019) return d;});
    rldata.line = rldata.line[0];
    ssankey(rldata,{

    });


  if (selectedTypeValue == 1) {// 全国各地区原煤生产量
    d3.csv(csv2).then((data, error) => {
      if (error) {
        console.log(error);
      } else {
        //选择年份
        data = d3.filter(data, d => { if (d["年份"] == selectedYearValue) return d; });
        //冒泡排序
        var ex;
        for (var i = 0; i < 30; i++) {
          for (var j = 29; j >= i; j--) {
            if (+data[j].原煤生产量 < +data[j + 1].原煤生产量) {
              ex = data[j];
              data[j] = data[j + 1];
              data[j + 1] = ex;
            }
          }
        }
        //切割数据，取前12个
        data = data.slice(0, 12);
        rawCoalProduction(data, {
        });
      };
    });
  }

  if (selectedTypeValue == 2) {// 全国各地区原油生产量
    d3.csv(csv3).then((data, error) => {
      if (error) {
        console.log(error);
      } else {
        //选择年份
        data = d3.filter(data, d => { if (d["年份"] == selectedYearValue) return d; });
        //冒泡排序
        var ex;
        for (var i = 0; i < 30; i++) {
          for (var j = 29; j >= i; j--) {
            if (+data[j].原油生产量 < +data[j + 1].原油生产量) {
              ex = data[j];
              data[j] = data[j + 1];
              data[j + 1] = ex;
            }
          }
        }
        //切割数据，取前12个
        data = data.slice(0, 12);
        crudeOilProduction(data, {
        });
      };
    });
  }

  if (selectedTypeValue == 3) {// 全国各地区天然气生产量
    d3.csv(csv4).then((data, error) => {
      if (error) {
        console.log(error);
      } else {
        //选择年份
        data = d3.filter(data, d => { if (d["年份"] == selectedYearValue) return d; });
        //冒泡排序
        var ex;
        for (var i = 0; i < 30; i++) {
          for (var j = 29; j >= i; j--) {
            if (+data[j].天然气生产量 < +data[j + 1].天然气生产量) {
              ex = data[j];
              data[j] = data[j + 1];
              data[j + 1] = ex;
            }
          }
        }
        //切割数据，取前12个
        data = data.slice(0, 12);
        naturalGasProduction(data, {
        });
      };
    });
  }

  if (selectedTypeValue == 4) {// 全国各地区发电量
    d3.csv(csv5).then((data, error) => {
      if (error) {
        console.log(error);
      } else {
        //选择年份
        data = d3.filter(data, d => { if (d["年份"] == selectedYearValue) return d; });
        //冒泡排序
        var ex;
        for (var i = 0; i < 30; i++) {
          for (var j = 29; j >= i; j--) {
            if (+data[j].发电量 < +data[j + 1].发电量) {
              ex = data[j];
              data[j] = data[j + 1];
              data[j + 1] = ex;
            }
          }
        }
        //切割数据，取前12个
        data = data.slice(0, 12);
        powerGeneration(data, {
        });
      };
    });
  }
}

updateDataYear();
